import React, {useState} from "react";

const Test = () =>{
    const [name, setName] = useState("Ravi");
    const handleChange = () => {
        console.log(name);
        setName("Ravichandran")
    }
    return(
        <div>
            <h1>{name}</h1>
            <button type="button" onClick={handleChange}>Click</button>
        </div>
    )
}
export default Test
